const Them = () =>{
    return(
        <div>
            <form action="#" method="POST" role="form" encType="multipart/form-data">
                <div style={{wi}}>
                    <label htmlFor>Nhập Tên Cây :</label>
                    <input type="text" className="form-control" name="Ten" id="Ten" placeholder="Nhập Tên Cây Cảnh" />
                </div>
            </form>
        </div>
    );
}
export default Them;
